import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const MyOrders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const navigate = useNavigate();

  const userInfo = useSelector((state) => state.userLogin?.userInfo);

  //   const userLogin = useSelector((state) => state.user);
  //   const { userInfo } = userLogin;

  useEffect(() => {
    // if (!userInfo) {
    //   navigate('/Beauty');
    //   return;
    // }

    const fetchOrders = async () => {
      try {
        const config = {
          headers: {
            Authorization: `Bearer ${userInfo.token}`,
          },
        };

        const { data } = await axios.get('/api/myorders', config);
        setOrders(data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch orders');
        setLoading(false);
      }
    };

    fetchOrders();
  }, [userInfo, navigate]);

  return (
    <div className="container" style={{ padding: '1rem' }}>
      <h2 style={{ marginBottom: '1rem' }}>ðŸ§¾ My Orders</h2>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p style={{ color: 'red' }}>{error}</p>
      ) : orders.length === 0 ? (
        <p>No orders yet.</p>
      ) : (
        <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
          {orders.map((order) => (
            <div
              key={order._id}
              style={{
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'space-between',
                border: '1px solid #ddd',
                borderRadius: '8px',
                padding: '1rem',
                background: '#f9f9f9',
              }}
            >
    {/* LEFT - Product Image + Info */}
<div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
  <img
    src={order.product?.image || 'https://via.placeholder.com/60'}
    alt={order.product?.name || 'Product'}
    style={{
      width: '60px',
      height: '60px',
      borderRadius: '8px',
      objectFit: 'cover',
    }}
  />
  <div>
    <h4 style={{ margin: 0 }}>{order.product?.name || 'Product Name'}</h4>
    {order.product?.description && (
      <p style={{ margin: '4px 0', fontSize: '13px', color: '#555' }}>
        {order.product.description}
      </p>
    )}
    <p style={{ margin: '4px 0', fontSize: '14px' }}>Qty: {order.quantity}</p>
    <p style={{ margin: '4px 0', fontSize: '14px' }}>Price: â‚¹{order.product?.price}</p>
  </div>
</div>

              {/* RIGHT - Order Details */}
              <div style={{ textAlign: 'right' }}>
                <p style={{ margin: 0 }}>
                  <strong>Date:</strong> {new Date(order.createdAt).toLocaleDateString()}
                </p>
                <p style={{ margin: '4px 0' }}>
                  <strong>Total:</strong> â‚¹{order.totalPrice}
                </p>
                <p style={{ margin: '4px 0' }}>
                  <strong>Payment:</strong> {order.isPaid ? 'Paid' : 'Pending'}
                </p>
                <p style={{ margin: '4px 0' }}>
                  <strong>Status:</strong> {order.status || 'Processing'}
                </p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>

  );

};

export default MyOrders;
